export const Contact = () => {

  return (
    <>
<section id="contact">
    <h2>Contact Information</h2>
    <p>Name: Diego Alejandro Morales Bravo</p>
    <p>Email: <a href="mailto:diegoMorales1359@gmail.com">diegoMorales1359@gmail.com</a></p>
</section>
    </>
  )
}
